import Leaflet from 'leaflet';
import mapMarkerImg from '../images/logo-icon.png'

const mapIcon = Leaflet.icon({
    iconUrl: mapMarkerImg,

    iconSize: [58, 68],
    iconAnchor: [29, 68],
    popupAnchor: [0, -60]
  })

  export default mapIcon;
